"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[15708],{65218:e=>{e.exports=JSON.parse('{"tag":{"label":"wellbeing","permalink":"/docs/tags/wellbeing","allTagsPath":"/docs/tags","count":4,"items":[{"id":"outdoors/Escape-the-Gym","title":"Escape the Gym: Unleash Your Fitness in the Great Outdoors","description":"Discover the benefits of taking your workout outside! This guide explores the physical and mental advantages of outdoor exercise, offering practical tips and safety advice for transitioning your fitness routine to the great outdoors. Learn how to ditch the gym and embrace a healthier, more enjoyable lifestyle.","permalink":"/docs/outdoors/Escape-the-Gym"},{"id":"wellness/Nurturing-Your-Social-Self","title":"Nurturing Your Social Self: The Importance of Connection in Holistic Wellness","description":"Explore the vital role of social connections in your overall well-being. Learn how nurturing relationships, setting healthy boundaries, and engaging with your community can significantly impact your mental and physical health. Discover practical strategies for building a strong support system and prioritizing your social well-being.","permalink":"/docs/wellness/Nurturing-Your-Social-Self"},{"id":"wellness/Stress-Less,-Live-More","title":"Stress Less, Live More: Holistic Strategies for Managing Modern-Day Pressure","description":"Discover practical and holistic strategies for managing modern-day stress. Learn to identify your stress triggers, develop healthy coping mechanisms, practice mind-body techniques, improve time management, and cultivate resilience for a less stressful and more fulfilling life.","permalink":"/docs/wellness/Stress-Less,-Live-More"},{"id":"wellness/The-Healing-Power-of-Nature","title":"The Healing Power of Nature: Connecting with the Earth for Holistic Well-being","description":"Discover the profound healing power of nature and learn how connecting with the earth can enhance your physical and mental well-being. Explore the science behind nature\'s benefits, the practice of forest bathing, and simple ways to incorporate nature into your daily life, even in urban settings. Embrace the holistic benefits of sunlight, fresh air, and outdoor activities for a healthier, happier you.","permalink":"/docs/wellness/The-Healing-Power-of-Nature"}],"unlisted":false}}')}}]);